<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\TenantConfig\Domain\TenantConfig;
use Civi\Lughauth\Features\Access\Tenant\Domain\TenantRef;
use Civi\Lughauth\Features\Access\TenantConfig\Domain\ValueObject\TenantConfigTenantVO;
use Civi\Lughauth\Features\Access\TenantConfig\Domain\ValueObject\TenantConfigInnerLabelVO;
use Civi\Lughauth\Features\Access\TenantConfig\Domain\ValueObject\TenantConfigForceMfaVO;
use Civi\Lughauth\Features\Access\TenantConfig\Domain\ValueObject\TenantConfigVersionVO;
use Civi\Lughauth\Features\Access\TenantConfig\Domain\TenantConfigAttributes;
use PHPUnit\Framework\TestCase;

final class TenantConfigAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new TenantConfigAttributes();
        $tenantOneValue = $this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock();
        $tenantOtherValue = $this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->tenant($tenantOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTenant());
        $this->assertNotEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTenant());
        $this->assertEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTenantOrDefault(TenantConfigTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTenantOrDefault(TenantConfigTenantVO::from($tenantOtherValue))->value());
        $value->unsetTenant();
        $this->assertEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTenantOrDefault(TenantConfigTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTenantOrDefault(TenantConfigTenantVO::from($tenantOtherValue))->value());
        $innerLabelOneValue = 'one';
        $innerLabelOtherValue = 'other';
        $copy = $value->innerLabel($innerLabelOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getInnerLabel());
        $this->assertNotEquals('other', $value->getInnerLabel());
        $this->assertEquals('one', $value->getInnerLabelOrDefault(TenantConfigInnerLabelVO::from($innerLabelOtherValue))->value());
        $this->assertNotEquals('other', $value->getInnerLabelOrDefault(TenantConfigInnerLabelVO::from($innerLabelOtherValue))->value());
        $value->unsetInnerLabel();
        $this->assertEquals('other', $value->getInnerLabelOrDefault(TenantConfigInnerLabelVO::from($innerLabelOtherValue))->value());
        $this->assertNotEquals('one', $value->getInnerLabelOrDefault(TenantConfigInnerLabelVO::from($innerLabelOtherValue))->value());
        $forceMfaOneValue = true;
        $forceMfaOtherValue = false;
        $copy = $value->forceMfa($forceMfaOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->getForceMfa());
        $this->assertNotEquals(false, $value->getForceMfa());
        $this->assertEquals(true, $value->getForceMfaOrDefault(TenantConfigForceMfaVO::from($forceMfaOtherValue))->value());
        $this->assertNotEquals(false, $value->getForceMfaOrDefault(TenantConfigForceMfaVO::from($forceMfaOtherValue))->value());
        $value->unsetForceMfa();
        $this->assertEquals(false, $value->getForceMfaOrDefault(TenantConfigForceMfaVO::from($forceMfaOtherValue))->value());
        $this->assertNotEquals(true, $value->getForceMfaOrDefault(TenantConfigForceMfaVO::from($forceMfaOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(TenantConfigVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(TenantConfigVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(TenantConfigVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(TenantConfigVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
